import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

class AboutUs extends Component {
  render() {
    return (
      <div>
        <h1 className="text-center text-white mb-3">Developers</h1>
        <div>
          <div className="container">
            <div className="row gutters-sm">
              <div className="col-md-4 mb-3 text-center text-white">
                Rushi Shah
              </div>
              <div className="col-md-4 mb-3 text-center text-white">
                Rishabh Tyagi
              </div>
              <div className="col-md-4 mb-3 text-center text-white">
                Nayan Chaturvedi
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default AboutUs;
